import React from 'react';

import Header from './componentes/header';  
import Footer from './componentes/footer';
import ProductGrid from './componentes/ProductGrid';


import './App.css';



function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <ProductGrid/>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
